		strmangle.WhereClauseRepeated(string(dialect.LQ), string(dialect.RQ), 1, loginInfoPrimaryKeyColumns, len(*o))

	q := queries.Raw(sql, args...)

	err := q.Bind(ctx, exec, &slice)
